import { MDBCol, MDBContainer, MDBRow } from "mdbreact";
import React, { useState } from "react";
import "./MyAccount.scss";

function MyAccount() {
  const [tab, setTab] = useState(0);

  return (
    <div>
      <MDBContainer>
        <div className="my-5 w-100 pt-5">
          <h1 className="w-100 text-center font-weight-bold">My Account</h1>
        </div>

        <MDBRow>
          <MDBCol sm="12" md="2">
            <div className="card rounded">
              <button
                onClick={() => {
                  setTab(1);
                }}
              >
                {" "}
                1
              </button>
              <button
                onClick={() => {
                  setTab(2);
                }}
              >
                2
              </button>
              <button
                onClick={() => {
                  setTab(3);
                }}
              >
                3
              </button>
              <button
                onClick={() => {
                  setTab(4);
                }}
              >
                4
              </button>
              <button>log out</button>
            </div>
          </MDBCol>
          <MDBCol sm="12" md="10">
            <div>
              {() => {
                switch (tab) {
                  case 1:
                    return <div>tab 1</div>;
                  case 2:
                    return <div>tab 2</div>;
                  case 3:
                    return <div>tab 3</div>;
                  case 4:
                    return <div>tab 4</div>;

                  default:
                    break;
                }
              }}
            </div>
          </MDBCol>
        </MDBRow>
      </MDBContainer>
    </div>
  );
}

export default MyAccount;
